import React from 'react';
import ListarCurso from '../ComponetsCurso';
import ListarGrupo from '../ComponentsGrupo';
import ListarEstudiante from '../ComponentsEstudiante';
import ListarProfesor from '../ComponentsProfesor';
import ListarUsuario from '../ComponentsUsuario';
class Menu extends React.Component {
    constructor(props) {
        super(props);
    }
    state = {  }
    render() { 
        return ( 

           
           <><ul class="nav nav-tabs" id="myTab" role="tablist">
                <li class="nav-item" role="presentation">
                    <button class="nav-link active" id="home-tab" data-bs-toggle="tab" data-bs-target="#home" type="button" role="tab" aria-controls="home" aria-selected="false">Inicio</button>
                </li>
                <li class="nav-item" role="presentation">
                    <button class="nav-link" id="profile-tab" data-bs-toggle="tab" data-bs-target="#curso" type="button" role="tab" aria-controls="curso" aria-selected="false">Curso</button>
                </li>
                <li class="nav-item" role="presentation">
                    <button class="nav-link" id="messages-tab" data-bs-toggle="tab" data-bs-target="#grupo" type="button" role="tab" aria-controls="grupo" aria-selected="false">Grupo</button>
                </li>
                <li class="nav-item" role="presentation">
                    <button class="nav-link" id="messages-tab" data-bs-toggle="tab" data-bs-target="#estudiante" type="button" role="tab" aria-controls="estudiante" aria-selected="false">Estudiante</button>
                </li>
                <li class="nav-item" role="presentation">
                    <button class="nav-link" id="messages-tab" data-bs-toggle="tab" data-bs-target="#profesor" type="button" role="tab" aria-controls="profesor" aria-selected="false">Profesor</button>
                </li>
                <li class="nav-item" role="presentation">
                    <button class="nav-link" id="messages-tab" data-bs-toggle="tab" data-bs-target="#usuario" type="button" role="tab" aria-controls="usuario" aria-selected="false">Usuario</button>
                </li>
            </ul><div class="tab-content">
                    <div class="tab-pane active" id="home" role="tabpanel" aria-labelledby="home-tab"> </div>
                    <div class="tab-pane" id="curso" role="tabpanel" aria-labelledby="profile-tab"> <ListarCurso ></ListarCurso> </div>
                    <div class="tab-pane" id="grupo" role="tabpanel" aria-labelledby="messages-tab"> <ListarGrupo></ListarGrupo></div>
                    <div class="tab-pane active" id="estudiante" role="tabpanel" aria-labelledby="home-tab"> <ListarEstudiante></ListarEstudiante> </div>
                    <div class="tab-pane" id="profesor" role="tabpanel" aria-labelledby="profile-tab"> <ListarProfesor></ListarProfesor> </div>
                    <div class="tab-pane" id="usuario" role="tabpanel" aria-labelledby="profile-tab"> <ListarUsuario></ListarUsuario> </div>
                </div></>


         );
    }
}
 
export default Menu;
